import React from "react";
import SearchBar from "../SearchBar/SearchBar";
import { Link } from "react-router-dom";
const Nav = (props) => {
    return (
      <div>
        <SearchBar onSearch={props.onSearch} />
        <link to ="/about"><h3><About></About></h3></link>
      </div>
    );
  }

export default Nav;
